import Nav from 'react-bootstrap/Navbar';
import img from '../Images/navlogo.jpg';
import { Container } from 'react-bootstrap';
import { faBars } from '@fortawesome/fontawesome-free-solid';
import Sidebar from './Sidebar';
function Navbar(){
   const expand = true;
    return(
        <>
           <Nav expand={true} className='bg-bg-primery mb-3' fixed='top'>
            <Container fluid>
                <Nav.Brand aria-expanded={true}> 
                    <img src={img} alt='navlogo' style={{height:"15px", width:"15px"}}/>
                </Nav.Brand>
                <Nav.Toggle aria-rowspan={'offcanvasNavbar-expand-true'}></Nav.Toggle>

                {/* Ofcanvas */}
                     <Sidebar/>

            </Container>
           </Nav>
        </>
    )
}

export default Navbar;
